import React from "react";
import Carousel from "@brainhubeu/react-carousel";
import "@brainhubeu/react-carousel/lib/style.css";
import './Carusel.css';

import one from './img/1.jpeg';
import two from './img/2.jpeg';
import tree from './img/3.jpeg';
import four from './img/4.jpeg';
import five from './img/5.jpeg';
import six from './img/6.jpeg';
import seven from './img/7.jpeg';

const Carusel = () => (
  <div
    className="Carusel"
 >
    <Carousel 
    slidesPerPage={5}
    slidesPerScroll={7}
    animationSpeed={1500}
    offset={10}
    itemWidth={100}
    clickToChange
    arrows >
    <img src={one} alt="academy" />
    <img src={two} alt="academy" />
    <img src={tree} alt="academy" />
    <img src={four} alt="academy" />
    <img src={five} alt="academy" />
    <img src={six} alt="academy" />
    <img src={seven} alt="academy" />
    <img src={two} alt="academy" />
    <img src={tree} alt="academy" />
    <img src={four} alt="academy" />
    <img src={five} alt="academy" />
    <img src={six} alt="academy" />
    <img src={seven} alt="academy" />
    </Carousel>
  </div>
);

export default Carusel;
